import React from 'react';
import { Link } from 'react-router-dom';
import { Stack, Button } from '@mui/material';
import Logo from '../assets/images/Logo.png';

const Navbar = () => (
<Stack 
    direction="row" 
    justifyContent="space-between" 
    alignItems="center"
    sx={{ 
        gap: { sm: '123px', xs: '20px' }, 
        mt: { sm: '32px', xs: '20px' }, 
        px: '20px', 
        py: '10px', 
        backgroundColor: '#fff', 
        boxShadow: '0 4px 12px rgba(0, 0, 0, 0.1)' 
    }}
    >
    <Link to="/">
        <img src={Logo} alt="logo" style={{ width: '150px', height: '72px', margin: '0px 20px' }} />
    </Link>
    <Stack
        direction="row"
        gap={{ sm: '40px', xs: '20px' }}
        fontFamily="Alegreya"
        fontSize={{ sm: '24px', xs: '18px' }}
        alignItems="center"
    >
    <Link to="/" style={{ textDecoration: 'none', color: '#3A1212', borderBottom: '3px solid #FF2625' }}>Home</Link>
        <a href="#exercises" style={{ textDecoration: 'none', color: '#3A1212' }}>Exercises</a>
    <Link to="/shop" style={{ textDecoration: 'none', color: '#3A1212' }}>Shop</Link>
    <Link to="/about" style={{ textDecoration: 'none', color: '#3A1212' }}>About Us</Link>
    <Button 
        component={Link} 
        to="/login" 
        variant="contained" 
        color="primary" 
        sx={{ 
            backgroundColor: '#3A1212', 
            color: 'white', 
            textTransform: 'none', 
            borderRadius: '20px', 
            padding: { sm: '8px 16px', xs: '6px 12px' }, 
            fontSize: { sm: '16px', xs: '14px' }, 
            '&:hover': {
            backgroundColor: '#FF2625'
            }
        }}
    >
        Login
    </Button>
    </Stack>
</Stack>
);

export default Navbar;
